{
  parentElem = $parent.reduce(`DemoTypes#ROOT`, element -> name -> $element.get(`tl.element:StructuredElementContainer#children`).filter(elem -> $elem.get(`DemoTypes:DemoTypes.All#name`) == $name).elementAt(0));
  if ($parentElem == null, 
  {
    "status": "error",
    "error_message": "Could not resolve parent.",
    "parent": $parent
  },
  {
    newName = $properties["name"];
    if ($newName == null, 
    {
      "status": "error",
      "error_message": "No name attribute given."
    },
    {
      existing = $parentElem.get(`tl.element:StructuredElementContainer#children`).filter(elem -> $elem.get(`DemoTypes:DemoTypes.All#name`) == $newName).elementAt(0);
      if ($existing != null,
      {
        "status": "error",
        "error_message": "Element with same name exists.",
        "child": $parent.concat($newName)
      },
      {
         result = new(resolveModelPart($elementType), $parentElem);
            // append new child to parent
         $parentElem.add(`tl.element:StructuredElementContainer#children`, $result);
         type = $result.type();
            // initialize attributes
         $properties.reduce(0, ignore -> keyValue -> $result.set($type.attribute($keyValue.getKey()), $keyValue.getValue()));
         {
           "status": "OK",
           "result": $parent.concat($newName)
         }
       })
    })
  })
}

{
  targetElem = $target.reduce(`DemoTypes#ROOT`, element -> name -> $element.get(`tl.element:StructuredElementContainer#children`).filter(elem -> $elem.get(`DemoTypes:DemoTypes.All#name`) == $name).elementAt(0));
  if ($targetElem == null, 
  {
    "status": "error",
    "error_message": "Could not resolve target.",
    "target": $target
  },
  {
    $targetElem.delete();
    {
      "status": "OK",
    "target": $target
    }
  })
}
